import './App.css';
import { albums } from './data';
import { Header } from "./components/header.js"

const image = albums[0]

function App() {
  return (
    <div className="App">
      <Header/>
      <div className='gamediv'>
      {
        albums.map((item, index) => {
        return (<div className='carddiv'>

            <img alt='' src={process.env.PUBLIC_URL + item.img} key={index}></img>
            <p>{process.env.PUBLIC_URL + item.text}</p>
            </div>  
        )})
      } 
      </div>   
      <footer>luiseseberre2023</footer>   
    </div>
  );
}

export default App;
